const SYNC_COMMITTEE_SIZE: usize = 512;
const LOG_2_SYNC_COMMITTEE_SIZE: usize = 9;
const G1_POINT_SIZE: usize = 48; 
const HASH_SIZE: usize = 32;

//将numBytes按照64bytes分组，每一组做hash，产出numBytes/2 bytes
pub fn ssz_layer(input: &Vec<u8>) ->Vec<u8>{
    assert!(input.len() >= 64 && input.len() % 64 == 0);
    let num_pairs = input.len() / 64;
    let mut output: Vec<u8> = Vec::new();

    for i in 0..num_pairs{ 
        output.extend_from_slice(&Sha256Bytes::digest(&input[i*64..(i+1)*64].to_vec()));
    }
    output
}   


//log2b = log2(numBytes/32), (32, 0), (64, 1), (128, 2), (256, 3), (512, 4), (1024, 5)
// SSZArray 限定输入的数据必须是32*(2**log2b) bytes, 输出的结果为array中这些element的hash root
// 假设有128 bytes
/*
    layer1 out                    [0, 32)
                                     |
    layer1   input  64        hasher[1][0][0..64)
                                /              \
    layer0  output         [0..32)            [32..64)
                             /                     \
    layer0  input  128   hasher[0][0][0..64)  hasher[0][1][64..128)
*/
pub fn ssz_array(input: &Vec<u8>, depth:usize) ->Vec<u8>{
    assert_eq!(input.len(),32 * (1 << depth));

    let mut layer_input = input.to_vec();
    
    for i in 0..depth{
        layer_input = ssz_layer(&layer_input);
    }
    
    layer_input.clone()
} 

// 计算sync committee hash 
fn ssz_phase0_sync_committee(
    pubkeys: &[[u8; G1_POINT_SIZE]],
    aggregate_pubkey: &[u8; G1_POINT_SIZE],
) -> [u8; 32] {

    let sync_committee_size = pubkeys.len();
    let depth = log2_usize(sync_committee_size);
    let mut ssz_pubkeys_input: Vec<u8> = Vec::with_capacity(sync_committee_size * 64);

    for i in 0..sync_committee_size {
        ssz_pubkeys_input.extend_from_slice(&pubkeys[i]);
        ssz_pubkeys_input.extend_from_slice(&[0u8; 64 - G1_POINT_SIZE]);

        // for j in 0..64 {
        //     if j < G1_POINT_SIZE{
        //         ssz_pubkeys_input.push(pubkeys[i][j]);
        //     }else{
        //         ssz_pubkeys_input.push(0);
        //     }
        // }
    }

    let ssz_pubkeys_output = ssz_array(&ssz_pubkeys_input, depth +1);

    let mut ssz_aggregated_pubkey_input: Vec<u8> = Vec::with_capacity(64);

    ssz_aggregated_pubkey_input.extend_from_slice(aggregate_pubkey);
    ssz_aggregated_pubkey_input.extend_from_slice(&[0u8; 64 - G1_POINT_SIZE]);

    // for i in 0..64 { //TODO, to be optimized
    //     if i < G1_POINT_SIZE{
    //         ssz_aggregated_pubkey_input.push(aggregate_pubkey[i]);
    //     }else{
    //         ssz_aggregated_pubkey_input.push(0);
    //     }
    // }

    let ssz_aggregated_pubkey_output = ssz_layer(&ssz_aggregated_pubkey_input); 

    let mut ssz_layer_input = Vec::with_capacity(64);
    ssz_layer_input.extend_from_slice(&ssz_pubkeys_output);
    ssz_layer_input.extend_from_slice(&ssz_aggregated_pubkey_output);

    let ssz_layer_output = ssz_layer(&ssz_layer_input);
    let result: [u8; 32] = ssz_layer_output[..HASH_SIZE].try_into().unwrap();
    result

}

//计算beacon block header
fn ssz_phase0_beacon_block_header(
    slot: &[u8; 32],
    proposer_index: &[u8; 32],
    parent_root: &[u8; 32],
    state_root: &[u8; 32],
    body_root: &[u8; 32],
) -> [u8; 32] {

    let mut ssz_input: Vec<u8> = Vec::with_capacity(256);
    ssz_input.extend_from_slice(slot);
    ssz_input.extend_from_slice(proposer_index);
    ssz_input.extend_from_slice(parent_root);
    ssz_input.extend_from_slice(state_root);
    ssz_input.extend_from_slice(body_root);
    ssz_input.extend_from_slice(&[0u8; 96]);

    let ssz_beacon_block_header = ssz_array(&ssz_input, 3);
    let result = ssz_beacon_block_header[..HASH_SIZE].try_into().unwrap();
    result
}

//计算beacon block sign root
fn ssz_phase0_signing_root(header_root: &[u8; HASH_SIZE], domain: &[u8; HASH_SIZE]) -> [u8; HASH_SIZE] {
    let mut input: Vec<u8> = Vec::with_capacity(64);
    input.extend_from_slice(header_root);
    input.extend_from_slice(domain);

    let output = ssz_layer(&input);
    let result: [u8; 32] = output[..HASH_SIZE].try_into().unwrap();
    result 
}

// 从merkle leaf 和path 中恢复出merke root。
fn ssz_restore_merkle_root(depth: usize, index: usize, leaf: [u8; HASH_SIZE], branch: &[[u8; HASH_SIZE]]) -> [u8; HASH_SIZE] {
    let mut hashers = vec![Sha256Bytes; depth];
    let mut first_offset;
    let mut second_offset;

    let mut input  =  [0u8; 64];
    let mut output =  [0u8; 32];

    for i in 0..depth {
        if (index / (1 << i)) % 2 == 1 {
            first_offset = 0;
            second_offset = 32;
        } else {
            first_offset = 32;
            second_offset = 0;
        }

        input[first_offset..].copy_from_slice(&branch[i]);
        
        if i == 0 {
            input[second_offset..].copy_from_slice(&leaf);
        }else{
            input[second_offset..].copy_from_slice(&output);
        }

        let input_vec = Vec::from(input);

        let output_vec = Sha256Bytes::digest(&input_vec);
        output = output_vec[..HASH_SIZE].try_into().unwrap();
    }
    output
}

fn log2_usize(x: usize) -> usize {
    if x == 0 {
        return 0; // 如果 x 为 0，则 log2(0) 未定义，返回 0 或抛出错误，这里选择返回 0
    }

    let mut n = x;
    let mut log = 0;

    while n > 1 {
        n >>= 1;
        log += 1;
    }

    log
}

